Solution:
To solve for $w$, we can multiply both sides of the equation $\frac{3}{5} w=\frac{4}{3}$ by $\frac{5}{3}$ to isolate $w$.
\begin{align*}
\frac{3}{5} w&=\frac{4}{3}\\
\frac{5}{3} \cdot \frac{3}{5} w&=\frac{5}{3} \cdot \frac{4}{3}\\
w&=\frac{20}{9}
\end{align*}
